function bin($teks)
{
    for($x = 0; $x < strlen($teks); $x++)
    {
        $hasil .= str_pad(decbin(ord($teks[$x])), 8, "0", STR_PAD_LEFT). " ";
    }
    echo $hasil;
}


function unbin($binnary)
{
    $binnary = explode(" ",$binnary);
    $hasil = "";
    foreach($binnary as $biner)
    {
        $hasil .= pack("H*", dechex(bindec($biner)));
    }
    echo $hasil;
}
